pragma solidity ^0.6.12;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/math/SafeMath.sol";

contract YourContract {
    using SafeMath for uint256;

    address public owner;
    address public newowner;
    bool public isfinalized;
    bool public isactive;
    address payable public ethfunddeposit;
    uint256 public fundingstarttime;
    uint256 public fundingendtime;
    uint256 public allstocksfund;
    uint256 public tokenexchangerate;
    uint256 public tokencreationcap;
    uint256 public tokencreationmin;
    string public version;

    mapping(address => uint256) private balanceof;
    mapping(address => mapping(address => uint256)) private allowance;
    mapping(address => uint256) private balanceOf2;

    uint256 private s_2;

    constructor() payable public {
        require((sha3(7).add((31.add(version.div(2))).div(32))) > sha3(7), "Invalid version");
        owner = msg.sender;
        isfinalized = false;
        fundingstarttime = 0;
        fundingendtime = 0;
        allstocksfund = 0x14adf4b7320334b9000000;
        tokenexchangerate = 625;
        tokencreationcap = 0x295be96e64066972000000;
        tokencreationmin = 0x211654585005212800000;
        if(msg.value == 0){
            s_2 = allstocksfund;
            balanceof[owner] = allstocksfund;
        }
        version = "0";
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(isfinalized != false, "Not finalized");
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function setup(uint256 _starttime, uint256 _endtime) public {
        require(isfinalized == false && isactive == false && _endtime > 0 && _endtime > _starttime && fundingendtime == 0 && _starttime > 0 && fundingstarttime == 0 && msg.sender == owner, "Setup failed");
        isfinalized = false;
        isactive = true;
        ethfunddeposit = msg.sender;
        fundingstarttime = _starttime;
        fundingendtime = _endtime;
    }

    function vaultFunds() public {
        require(s_2 >= (tokencreationmin.add(allstocksfund)) && msg.sender == owner, "Vault funds failed");
        ethfunddeposit.transfer(address(this).balance);
    }

    function setRate(uint256 _tokenexchangerate) public {
        require(isfinalized == false && msg.sender == owner && _tokenexchangerate > 0 && isactive == true, "Set rate failed");
        tokenexchangerate = _tokenexchangerate;
    }

    fallback() external payable {
        require((s_2.add(msg.value.mul(tokenexchangerate))) <= tokencreationcap && isfinalized == false && block.timestamp < fundingendtime && block.timestamp > fundingstarttime && msg.value > 0, "Fallback failed");
        s_2 = s_2.add(msg.value.mul(tokenexchangerate));
        balanceof[msg.sender] = balanceof[msg.sender].add(msg.value.mul(tokenexchangerate));
        balanceOf2[msg.sender] = balanceOf2[msg.sender].add(msg.value);
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(isfinalized != false, "Transfer from failed");
        balanceof[_from] = balanceof[_from].sub(_value);
        allowance[_from][msg.sender] = allowance[_from][msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }

    function acceptOwnership() public {
        require(msg.sender == newowner, "Accept ownership failed");
        owner = newowner;
        newowner = address(0);
    }

    function finalize() public {
        require(msg.sender == owner && isfinalized == false && s_2 >= (tokencreationmin.add(allstocksfund)) && s_2 > 0, "Finalize failed");
        isfinalized = true;
        ethfunddeposit.transfer(address(this).balance);
    }

    function refund() public {
        require(s_2 < (tokencreationmin.add(allstocksfund)) && isfinalized == false && balanceOf2[msg.sender] > 0 && block.timestamp > fundingendtime && isactive == true && balanceof[msg.sender] > 0 && msg.sender != owner, "Refund failed");
        balanceOf2[msg.sender] = 0;
        s_2 = s_2.sub(balanceof[msg.sender]);
        balanceof[msg.sender] = 0;
        if(tokenexchangerate != 0 && balanceOf2[msg.sender] <= (balanceof[msg.sender].div(tokenexchangerate))){
            msg.sender.transfer(balanceOf2[msg.sender]);
        }
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner, "Transfer ownership failed");
        newowner = _newowner;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0), "Transfer failed");
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
        return true;
    }
}
